import axios from 'axios';

REACT_APP_BASE_INSTAGRAM_URL;
const instagramPostsUrl = process.env.REACT_INSTAGRAM_POSTS_URL;

const API_KEY = process.env.REACT_INSTAGRAM_POSTS_URL;

const FetchUserInstagramPosts = async id => {
  const options = {
    method: 'GET',
    url: instagramPostsUrl,
    params: {
      user_id: '25025320',
    },
    headers: {
      'x-rapidapi-key': API_KEY,
      'x-rapidapi-host':
        'instagram-scrapper-posts-reels-stories-downloader.p.rapidapi.com',
    },
  };

  try {
    const response = await axios.request(options);
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
};

export default FetchUserInstagramPosts;
